import React from 'react';
import ReactDOM from 'react-dom';
import {Navbar} from 'react-bootstrap';
import {Link} from 'react-router-dom';

const NavBar = (props) => {

    return (
        <Navbar bg="light" expand="lg">
            <Navbar.Brand>
                <Link to="/">Bhogandev</Link> 
            </Navbar.Brand>
        </Navbar>
    )
}

export default NavBar;
